import Button from '../../atoms/Button/Button';
import Input from '../../atoms/Input/Input';
import styles from './Input.module.css';

type FormProps = { 
  handleChange: () => any,
  handleSubmit:() => any,
  form: object,
};

const Form: React.FC<FormProps> = ({handleChange, handleSubmit, form}) => {

  return (
    <form className={styles.form} onSubmit={handleSubmit}>
        {form.fields.map((field:object) => (
            <Input 
                key={field.id} 
                id={field.id} 
                label={field.label}
                name={field.name}
                handleChange={handleChange}
                type={field.type}
            />
        ))}
        <div className={styles.buttonsContainer}>
            <Button
                type="submit"
                text={form.confirmButton.text}
                style={form.confirmButton.style}
                disabled={form.confirmButton.disabled}
            />
            <Button
                type="button"
                handleClick={form.cancelButton.onClick}
                text={form.cancelButton.text}
                style={form.cancelButton.style}
                disabled={form.cancelButton.disabled}
            />
        </div>
    </form>
  );
}

export default Form;
